export function getScheduleForEmployee(name: string): Record<string, ShiftCode> {
  const surname = name.split(',')[0].trim();
  const entry = SCHEDULE_2026.find(e => 
    surname.toLowerCase().includes(e.surname.toLowerCase()) ||
    e.surname.toLowerCase().includes(surname.toLowerCase())
  );
  
  return entry?.schedule || {};
}

export function getEmployeeGroup(name: string): string {
  const surname = name.split(',')[0].trim();
  const entry = SCHEDULE_2026.find(e => 
    surname.toLowerCase().includes(e.surname.toLowerCase()) ||
    e.surname.toLowerCase().includes(surname.toLowerCase())
  );
  
  return entry?.group || 'TMBA';
}
